import React from 'react';
import {TextField} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import {Button, Container, Col, Row} from 'react-bootstrap'

const useStyles = makeStyles((theme) => ({
  root: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
      width: '25ch',
    },
  },
}));

export default function SignUp() {
  const classes = useStyles();

  return (
    <Container>
        <Row>
            <Col>
                <form  method="POST" className={classes.root} noValidate autoComplete="off">
                   <div>
                        <TextField required id="standard-required" label="username" type="text"/><br/>
                        <TextField required id="standard-required" label="Emai" type="email" /><br/>
                        <TextField id="standard-number" label="Mobile Number"  type="number"/><br/>
                        <TextField id="standard-password-input" label="Password" type="password"  autoComplete="current-password"/><br/>
                        <TextField id="standard-password-input" label="Confirm Password" type="password"  autoComplete="current-password"/><br/>
                        <Button variant="success">Register</Button>
                  </div>
                </form>
            </Col>
            <Col>
            </Col>

        </Row>
    <form  method="POST" className={classes.root} noValidate autoComplete="off">
      <div>
        <TextField required id="standard-required" label="username" type="text"/><br/>
        <TextField required id="standard-required" label="Emai" type="email" /><br/>
        <TextField id="standard-number" label="Mobile Number"  type="number"/><br/>
        <TextField id="standard-password-input" label="Password" type="password"  autoComplete="current-password"/><br/>
        <TextField id="standard-password-input" label="Confirm Password" type="password"  autoComplete="current-password"/><br/>
        <Button variant="success">Register</Button>
      </div>
    </form>
   </Container>
  );
}
